      states: {
        select: {
          borderColor: '#B5ACFF',
          color: '#7A77FF',
        },
      },
    },
  ],
 }; 
 const staticOptions_may = {
  title: {
    text: ' ',
    useHTML: false,
  },
  series: [
    {
      name: 'Basemap',
      mapData: mapData_may,
      borderColor: '#FFC3BA',
      borderWidth: 0.5,
      nullColor: '#FFEAE4',
      showInLegend: false,
      allowPointSelect: true,
      dataLabels: {
        enabled: false,
        format: '{point.name}',
        color: '#000',
      },
      states: {
        select: {
          borderColor: '#B5ACFF',
          color: '#7A77FF',
        },
      },
    },
  ],
 }; 
 const staticOptions_guy = {
  title: {
    text: ' ',
    useHTML: false,
  },
  series: [
    {
      name: 'Basemap',
